INSERT INTO `im_notice` VALUES (1790437937348345858, 1, '君子坦荡荡，小人长戚戚。', 0, '<p>这种事实对本人来说意义重大, 相信对这个世界也是有一定意义的.生活中, 若随机一段废话出现了, 我们就不得不考虑它出现了的事实. 就我个人来说, 随机一段废话对我的意义, 不能不说非常重大. 我们一般认为, 抓住了问题的关键, 其他一切则会迎刃而解.既然如此, 本人也是经过了深思熟虑,在每个日日夜夜思考这个问题. 了解清楚随机一段废话到底是一种怎么样的存在, 是解决一切问题的关键.在这种不可避免的</p>', 'http://0tyu52i.site/ea59.html', 1, '2024-05-15 01:44:04', 1, '2024-05-15 01:44:04', 103, '000000');
