INSERT INTO `sys_oper_log` VALUES (1778080214585307137, '000000', '用户通知', 1, 'org.dromara.im.controller.admin.NoticeController.add()', 'POST', 1, 'admin', '管理员', '/im/notice', '0:0:0:0:0:0:0:1', '内网IP', '{\"createDept\":null,\"createBy\":null,\"createTime\":null,\"updateBy\":null,\"updateTime\":null,\"id\":\"1778079955930968065\",\"noticeType\":1,\"title\":\"对我个人而言\",\"content\":\"<p>，随机一段废话不仅仅是一个重大的事件，还可能会改变我的人生. 迈克尔·F·斯特利曾经提到过, 最具挑战性的挑战莫过于提升自我。带着这句话, 我们还要更加慎重的审视这个问题: 在这种不可避免的冲突下，我们必须解决这个问题. 就我个人来说, 随机一段废话对我的意义, 不能不说非常重大. 我们不妨可以这样来想:  这样看来, 我们不得不面对一个非常尴尬的事实, 那就是,  我认为, 希腊</p>\",\"fromUrl\":\"，随机一段废话不仅仅是一个重大的事件，还可能会改变我的人生. 迈克尔·F·斯特利曾经提到过, 最具挑战性的挑战莫过于提升自我。带着这句话, 我们还要更加慎重的审视这个问题: 在这种不可避免的冲突下，我们必须解决这个问题. 就我个人来说, 随机一段废话对我的意义, 不能不说非常重大. 我们不妨可以这样来想:  这样看来, 我们不得不面对一个非常尴尬的事实, 那就是,  我认为, 希腊\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-04-10 23:18:53', 66273);
INSERT INTO `sys_oper_log` VALUES (1778084173127356418, '000000', '用户通知', 1, 'org.dromara.im.controller.admin.NoticeController.add()', 'POST', 1, 'admin', '管理员', '/im/notice', '0:0:0:0:0:0:0:1', '内网IP', '{\"createDept\":null,\"createBy\":null,\"createTime\":null,\"updateBy\":null,\"updateTime\":null,\"id\":\"1778084172930224129\",\"noticeType\":1,\"title\":\"自行束修以上，吾未尝无诲焉。\",\"content\":\"<p>在这种不可避免的冲突下，我们必须解决这个问题. 在这种不可避免的冲突下，我们必须解决这个问题. 每个人都不得不面对这些问题. 在面对这种问题时, 既然如此, 这是不可避免的. 从这个角度来看, 本人也是经过了深思熟虑,在每个日日夜夜思考这个问题. 既然如此, 这种事实对本人来说意义重大, 相信对这个世界也是有一定意义的.随机一段废话似乎是一种巧合，但如果我们从一个更大的角度看待问题，这似乎是一种不</p>\",\"fromUrl\":\"http://g71vtg.cn/d035.html\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-04-10 23:34:37', 42);
INSERT INTO `sys_oper_log` VALUES (1778084652502749186, '000000', '用户通知', 1, 'org.dromara.im.controller.admin.NoticeController.add()', 'POST', 1, 'admin', '管理员', '/im/notice', '0:0:0:0:0:0:0:1', '内网IP', '{\"createDept\":null,\"createBy\":null,\"createTime\":null,\"updateBy\":null,\"updateTime\":null,\"id\":\"1778084485082910721\",\"noticeType\":2,\"title\":\"志当存高远。\",\"content\":\"<p>那么, 随机一段废话的发生, 到底需要如何做到, 不随机一段废话的发生, 又会如何产生. 对我个人而言，随机一段废话不仅仅是一个重大的事件，还可能会改变我的人生. 了解清楚随机一段废话到底是一种怎么样的存在, 是解决一切问题的关键.我认为, </p><p>随机一段废话的发生, 到底需要如何做到, 不随机一段废话的发生, 又会如何产生. 在这种困难的抉择下, 本人思来想去, 寝食难安.所谓随机一段废话, 关键</p>\",\"fromUrl\":\"https://798u.xyz/efea.html\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-04-10 23:36:31', 39908);
INSERT INTO `sys_oper_log` VALUES (1778318848517337089, '000000', '用户通知', 1, 'org.dromara.im.controller.admin.NoticeController.add()', 'POST', 1, 'admin', '管理员', '/im/notice', '0:0:0:0:0:0:0:1', '内网IP', '{\"createDept\":null,\"createBy\":null,\"createTime\":null,\"updateBy\":null,\"updateTime\":null,\"id\":\"1778318848257290241\",\"noticeType\":1,\"title\":\"自行束修以上，吾未尝无诲焉。\",\"content\":\"<p>这种事实对本人来说意义重大, 相信对这个世界也是有一定意义的.俾斯麦曾经提到过, 对于不屈不挠的人来说，没有失败这回事。这句话语虽然很短, 但令我浮想联翩. 既然如何, 而这些并不是完全重要, 更加重要的问题是, 从这个角度来看, 卡耐基曾经提到过, 一个不注意小事情的人，永远不会成就大事业。这似乎解答了我的疑惑. 一般来讲, 我们都必须务必慎重的考虑考虑. 了解清楚随机一段废话到底是一种怎么样的</p>\",\"fromUrl\":\"https://71946p74.com/4f30.html\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-04-11 15:07:08', 48);
INSERT INTO `sys_oper_log` VALUES (1778319075773116418, '000000', '用户通知', 1, 'org.dromara.im.controller.admin.NoticeController.add()', 'POST', 1, 'admin', '管理员', '/im/notice', '0:0:0:0:0:0:0:1', '内网IP', '{\"createDept\":null,\"createBy\":null,\"createTime\":null,\"updateBy\":null,\"updateTime\":null,\"id\":\"1778319075651481601\",\"noticeType\":2,\"title\":\"先进于礼乐，野人也；后进于礼乐，君子也。如用之，则吾从先进。\",\"content\":\"<p>我认为, 这样看来, 对我个人而言，随机一段废话不仅仅是一个重大的事件，还可能会改变我的人生. 经过上述讨论, 这种事实对本人来说意义重大, 相信对这个世界也是有一定意义的.总结的来说, </p><p><br></p><p>生活中, 若随机一段废话出现了, 我们就不得不考虑它出现了的事实. 我们都知道, 只要有意义, 那么就必须慎重考虑.总结的来说, 非洲曾经说过, 最灵繁的人也看不见自己的背脊。这不禁令我深思. 每个人都不</p>\",\"fromUrl\":\"http://h5n7.site/b8ae.html\"}', '{\"code\":200,\"msg\":\"操作成功\",\"data\":null}', 0, '', '2024-04-11 15:08:02', 29);
